	add("wildcat", "{\"term\":\"wildcat\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"A {{contraction of|wild cat|lang\u003den|nocap\u003d1}}Its adjectival senses were originally American and derived from the \u0026quot;wildcat banks\u0026quot; of Michigan, following its elevation to statehood in 1837. Two {{nowrap|laws—}}one easing the requirements for establishing a new bank and another occasioned by the Panic of 1837 that removed the need for payment in {{nowrap|specie—}}led to the creation and collapse of around 50 banks within two years.\u0026lt;ref\u0026gt;Wittmann, Matthew. \u0026quot;[http://www.anspocketchange.org/the-wildcat-bank-of-brest/ The Wildcat Bank of Brest]\u0026quot; for \u0027Pocket Change: The Blog of the American Numismatic Society\u0027. 14 May 2015.\u0026lt;/ref\u0026gt;\u0026lt;ref\u0026gt;Dunbar, Willis F. \u0026amp;\u0026amp;nbsp;al. \u0027[https://books.google.com/books?id\u003dHqGWEAnByeMC Michigan: A History of the Wolverine State]\u0027, [https://books.google.com/books?id\u003dHqGWEAnByeMC\u0026amp;pg\u003dPA222 pp.\u0026amp;nbsp;222\u0026amp;nbsp;ff.]\u0026lt;/ref\u0026gt; The term is apocryphally derived from a wildcat supposedly featured on the currency printed by one of these banks,\u0026lt;ref\u0026gt;\u0027Webster\u0027s Revised Unabridged Dictionary. \u0026quot;[http://machaut.uchicago.edu/?resource\u003dWebster%27s\u0026amp;word\u003dwild-cat\u0026amp;use1913\u003don\u0026amp;use1828\u003don Wild-cat]\u0026quot;. G.\u0026amp;nbsp;\u0026amp; C. Merriam Co., 1913.\u0026lt;/ref\u0026gt; but more probably derived from the remote locations \u0026quot;where the wildcats roamed\u0026quot; chosen by these banks to avoid oversight and minimize redemption of notes.\u0026lt;ref\u0026gt;Dwyer, Gerald P. Jr. \u0026quot;[http://www.frbatlanta.org/-/media/Documents/filelegacydocs/ACFCE.pdf Wildcat Banking, Banking Panics, and Free Banking in the United States]\u0026quot; for \u0027Economic Review\u0027. Federal Reserve Bank of Atlanta, 1996.\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cat that lives in the wilderness, \u0027specifically\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Felis silvestris\u0027, a common small Old World wild cat somewhat larger than a house cat\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A bobcat (\u0027Lynx rufus\u0027) or other similar New World species of lynx\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any feral cat\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"any undomesticated felid, as tigers or lions\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2003 April 24\u0027\u0027, CN\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Upon checking it out, we found a total of 13 newborn \u0027\u0027wildcats\u0027\u0027: nine newborn tigers and two newborn leopards\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A person who acts like a wildcat, a violent and easily-angered person or a sexually vigorous one\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2002 September 26\u0027\u0027, \u0027The Young and the Restless\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Anyone who\u0027s man enough to have landed a \u0027\u0027wildcat\u0027\u0027 like you had to be quite a guy\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"An offensive formation with an unbalanced offensive line and a snap directly to the running back rather than the quarterback\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A wheel that can be adjusted so as to revolve either with or on the shaft of a capstan\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"a customized or hand-made cartridge\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"a strike undertaken without authorization from the relevant trade union\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"notes issued by a wildcat bank\", \"priority\":15}]}, \"synonyms\":{}}");

