	add("william", "{\"term\":\"william\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"old high german (ca. 750-1050)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027willame\u0027 lt;!--many variants exist--\u0026gt;, from Old high german (ca. 750-1050) \u0027willahelm\u0027 from \u0027willo\u0027 (will) + \u0027helm\u0027 (helmet)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"popular since the Norman Conquest\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1605\u0027\u0027 w:William William Camden, \u0027Remains Concerning Britain\u0027, John Russell Smith, 1870, p.98\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"This name hath been most common in England since King \u0027\u0027William\u0027\u0027 the Conquerour,insomuch that upon a festival day in the Court of King Henry the Second, when Sir \u0027\u0027William\u0027\u0027 Saint-John, and Sir \u0027\u0027William\u0027\u0027 Fitz-Hamon, especial Officers, had commanded that none but of the name of \u0027\u0027William\u0027\u0027 should dine in the great Chamber with them, they were accompanied with a hundred and twenty \u0027\u0027Williams\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027 w:Christopher Christopher Wood, \u0027California, Here I Am\u0027, TwentyFirst Century Publishers Ltd, ISBN 1904433219, page29-30\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"By the same token I should probably have called myself \u0027Bill\u0027. With a name like \u0027\u0027William\u0027\u0027 you have choices. Very handy for us chameleons. \u0027\u0027William\u0027\u0027 is stern and dignified. A little austere and unapproachable. He conquers things. It is what my mother calls me when she is angry with me\", \"priority\":5}]}, \"synonyms\":{}}");

